import React from "react";
import EosFooterLogo from "../Assets/eos-logo-horizontal-white.png";

function Footer() {
  return (
    <div className="footer-div">
      <img className="footer-logo" src={EosFooterLogo} alt="Company Logo" />
    </div>
  );
}

export default Footer;
